import React from 'react';
import './App.css';
import OnermEntry from './components/OnermEntry';
import PrWarmup from './components/PrWarmup';
import ReverseMax from './components/ReverseMax';
import SetPlanner from './components/SetPlanner';
import Header from './components/Header';
import Menu from './components/Menu'

function App() {

  return (
    <div className="App">
      <Header/>
      <OnermEntry/>
      <PrWarmup/>
      <ReverseMax/>
      <SetPlanner/>
      <Menu/>
    </div>
  );
}

export default App;
